// src/components/Reports.jsx
import React, { useState, useEffect } from 'react';
import { Card, Table, Button, Row, Col } from 'react-bootstrap';
import { getEmployeeStatistics, getAttendanceReport, getLeaveReport, getPerformanceData } from '../services/reportService';
import { Line, Bar } from 'react-chartjs-2';
import { Chart as ChartJS } from 'chart.js/auto';

const Reports = () => {
  const [employeeStats, setEmployeeStats] = useState({});
  const [attendanceData, setAttendanceData] = useState([]);
  const [leaveData, setLeaveData] = useState([]);
  const [performanceData, setPerformanceData] = useState({});

  // Load all reports
  const loadReports = async () => {
    const stats = await getEmployeeStatistics();
    const attendance = await getAttendanceReport();
    const leave = await getLeaveReport();
    const performance = await getPerformanceData();

    setEmployeeStats(stats);
    setAttendanceData(attendance);
    setLeaveData(leave);
    setPerformanceData(performance);
  };

  useEffect(() => {
    loadReports();
  }, []);

  return (
    <div className="dashboard-container">
      <h3>Statistikat dhe Raportet</h3>

      <Row className="mt-4">
        <Col md={6}>
          <Card>
            <Card.Body>
              <Card.Title>Raport për Punonjësit</Card.Title>
              <Table striped bordered hover>
                <thead>
                  <tr>
                    <th>Statusi</th>
                    <th>Numri</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>Total</td>
                    <td>{employeeStats.total}</td>
                  </tr>
                  <tr>
                    <td>Aktivë</td>
                    <td>{employeeStats.active}</td>
                  </tr>
                  <tr>
                    <td>Joaktivë</td>
                    <td>{employeeStats.inactive}</td>
                  </tr>
                </tbody>
              </Table>
            </Card.Body>
          </Card>
        </Col>

        <Col md={6}>
          <Card>
            <Card.Body>
              <Card.Title>Raport për Prezencën</Card.Title>
              <Bar
                data={{
                  labels: ['Ditë të Pranishme', 'Ditë të Munguar'],
                  datasets: [
                    {
                      label: 'Prezenca',
                      data: attendanceData,
                      backgroundColor: ['#28a745', '#dc3545'],
                    },
                  ],
                }}
              />
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row className="mt-4">
        <Col md={6}>
          <Card>
            <Card.Body>
              <Card.Title>Raport për Pushimet</Card.Title>
              <Line
                data={{
                  labels: ['Pushime të Paguara', 'Pushime të Paduara'],
                  datasets: [
                    {
                      label: 'Pushime',
                      data: leaveData,
                      backgroundColor: ['#ffc107', '#007bff'],
                    },
                  ],
                }}
              />
            </Card.Body>
          </Card>
        </Col>

        <Col md={6}>
          <Card>
            <Card.Body>
              <Card.Title>Performanca e Punonjësve</Card.Title>
              <Bar
                data={{
                  labels: Object.keys(performanceData),
                  datasets: [
                    {
                      label: 'Performanca',
                      data: Object.values(performanceData),
                      backgroundColor: '#007bff',
                    },
                  ],
                }}
              />
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Reports;
